var tipuesearch = {"pages": [{'title': 'About.', 'text': 'This is  https://github.com/mdecourse/cmstemplate \n 目前的 cmsimde 在編輯器下方新增一個 csave 按鈕, 意即 collabrative save, 當動態網際管理系統在多人同時維護登入維護網頁內容時, 編輯各頁面時段, 該頁面可能已經改版, 因此使用 csave 按鈕存檔時, 會導入當下最新的該頁面內容, 並試圖與編輯中的頁面內容進行合併. \n 使用 csave 按鈕存檔無法刪除頁面資料. \n 使用 Edit All 模式, 無法使用 csave 按鈕（尚未測試).測試 \n \n', 'tags': '', 'url': 'About..html'}, {'title': 'W1', 'text': '新的開始，現在上課都有影片了!忘記了還能自己看影片複習一下 \n https://www.youtube.com/channel/UCJ0Ye3mhMApH0yxAcwCXs5g/videos \n', 'tags': '', 'url': 'W1.html'}, {'title': 'W2', 'text': '', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '找網站步驟 \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': 'push \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': '今天改版更新 \n', 'tags': '', 'url': 'W5.html'}, {'title': 'w6', 'text': '建立heroku帳號 \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '利用 heroku git:remote -a 設定的同步倉儲其推送名稱內定為 "heroku", 使用者只要使用 git push heroku 就可以將改版內容推送到對應的 Heroku app 倉儲. \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '各組開始執行期中分組專題 \n 在上週 \xa0 Heroku 實作 中, 使用 heroku5 AT mde 建立了 \xa0 https://taiwan-no1.herokuapp.com \xa0 (與 \xa0 https://github.com/heroku5/taiwan-no1 \xa0 Github Pages 的靜態內容同步). \n 接下來我們要將執行一項 網際程式開發 , 也就是以分組架構在期中考週前完成 分組專題的製作 . \n 其中必須要先設法完成 \xa0 Topic0 \xa0 中的程式練習, 學會如何從教務主機中取出機械設計工程系各實習實驗室的排課時間表後, 再設法部署到 Heroku. \n W9 週各組將要利用 ShareX 上台使用 Reveal 網際簡報錄製分組專題報告, 相關分組報告影片可參考協同產品設計實習 \xa0 Stage1 簡報影片 . \n \n', 'tags': '', 'url': 'w8.html'}, {'title': 'W9', 'text': '打期望成績 \n', 'tags': '', 'url': 'W9.html'}, {'title': 'W10', 'text': '\xa0下載\xa0DB Browser for SQLite - .zip (no installer) for 64-bit \n 下載\xa0 robodk522_kmol.7z \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11', 'text': '', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': 'YouTube直播 \n', 'tags': '', 'url': 'W12.html'}, {'title': 'W13', 'text': 'DK教學 \n \n 這禮拜開始同步教學 \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '利用 Ethercalc 取得各組員學號與 Github 帳號資料後, 希望透過程式方法建立所需的倉儲與網站連結 html,說明如何利用程式方法建立各組員的倉儲與網頁連結 說明如何利用 git remote add 建立 Gitlab 同步倉儲與網站 \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '課程時間內, 號召組員進行一段 30 分種的線上會議\xa0 \n 創建倉儲 \n 上傳到fossil的新指令 \n \n push前要先改acp \n \n 這樣才能push \n \n', 'tags': '', 'url': 'W15.html'}, {'title': 'W16', 'text': '', 'tags': '', 'url': 'W16.html'}, {'title': '期中報告', 'text': 'BGA0801教室使用時間表 \n 更改變數 ?classroomno?BGA.... \n', 'tags': '', 'url': '期中報告.html'}, {'title': '網路環境', 'text': '在學校:以學校電腦為主使用學校專用的網路來連線，上課時需要使用proxy來連接到學校的主機才能正確上網，主要是以ipv6來做連線 \n 缺點是學校主機出問題會導致所有電腦無法連線， proxy設定錯誤也無法連線(要到特定的主機(69 53之類的)) \n 在家裡:以自家電腦或筆電為主，連家裡的無線基地台或手機網路來上網，不需要設定proxy，主要是以ipv4來做連線。 \n 缺點是無法連接到需要ipv6才能進入的網站 \n \n 心得:在學校平時不需要特別設定網路，但如果無法上網基本上就是有設定錯誤，要想辦法解決相當麻煩，在家則是要在意的只有網路的穩定程度，沒網路跟天氣有較大的關西，不用去看設定，當然隨身系統內專門為ipv6的設定基本要關閉。 \n \n', 'tags': '', 'url': '網路環境.html'}, {'title': 'Heroku 網站', 'text': '1. 進入\xa0 https://heroku.com , 利用學校配發的 @gm 登記一個 Heroku 帳號, 關鍵在於密碼設定必須要至少 8 個字元, 且字元中必須包含符號, 英文字母及數字,\xa0 並且登記後要進入 @gm 帳號進行確認後才能開通 Heroku 帳號 \n 2.建立一個新的倉儲如:s409231xx \n 3.下載 Heroku cli 程式檔案, 解開至隨身碟 \n 4.修改start的路徑: \n 5.輸入: heroku version 若 回應所使用的版本表示上述路徑設定已經成功 \n 6.heroku login \xa0 -i\xa0 以 interactive 模式登入 Heroku \n 7.設定同步倉儲\xa0\xa0heroku git:remote -a s409231xx \n 8.推送git push heroku\xa0 \n \n', 'tags': '', 'url': 'Heroku 網站.html'}, {'title': '動態網站', 'text': '動態heroku https://dashboard.heroku.com/apps/q40923122 \n 1.創新的Heroku，不能用已經推送過的，不然會一直錯誤。 \n 2.創新的Github，然後把 \xa0 Procfile , \xa0 requirements.txt \xa0 與 \xa0 runtime.txt , \xa0，都推送上去。 \n 3.設定wsgi.py(負責打開6~9樓教室課表)(最下面) \n 4.最後就是推送， Github跟Heroku，更改變數 ?classroomno?BGA.... \n \n', 'tags': '', 'url': '動態網站.html'}, {'title': '網路直播', 'text': '說明如何透過線上 OBS + Youtube 進行直播 \n \n', 'tags': '', 'url': '網路直播.html'}, {'title': 'RoboDK 執行', 'text': 'DK教學兩題都在裡面 \n', 'tags': '', 'url': 'RoboDK 執行.html'}]};